function Todos() {
  return (
    <div>
      <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
      </ul>
      {[<li>1</li>, <li>2</li>, <li>3</li>]}
    </div>
  );
}

export default Todos;
